import Vue from 'vue';
import Router from 'vue-router';
import Login from '@/components/Login.vue';
import Signup from '@/components/Signup.vue';

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/login',
      name: 'Login',
      component: Login
    },
    {
      path: '/signup',
      name: 'Signup',
      component: Signup
    }
  ]
});
